<script>
var counter = 0;
function expandfs(){
	$("#terminal").show();
	$.get("expfs_handler.php", function(data, status){
        if (data.includes("DONE")){
			$("#terminal").append(data);
			$("#terminal").append("<br>[info] SYSTEM REBOOTING IN 10 SECONDS <br>");
			$("html, body").animate({ scrollTop: $(document).height() }, 1000);
			setTimeout(function(){ forceReboot(); }, 10000);
			setTimeout(function(){ RebootReminder(); }, 5000);
		}
    });
}

function RebootReminder(){
	$("#terminal").append("[info] SYSTEM REBOOTING IN 5 SECONDS <br>");
	$("html, body").animate({ scrollTop: $(document).height() }, 1000);
}

function forceReboot(){
	$("#terminal").append("[info] SYSTEM REBOOTING...<br>");
	setTimeout(function(){ window.location.reload(); }, 60000);
	setInterval(function(){ printDots(); }, 1200);
	$.get("../power/reboot_cb42e419a589258b332488febcd5246591ea4699974d10982255d16bee656fd8.php", function(){
		//This get request will not response anything as the system is shutting down
	});
	
}

function printDots(){
	//You know, people just like to watch something moving while waiting for the loading
	$("#terminal").append(".");
}
</script>
